$ErrorActionPreference = "SilentlyContinue"
$OldWallpaper = (Get-ItemProperty "HKCU:\Control Panel\Desktop\" -Name Wallpaper).Wallpaper

Function Get-ScreenResolution {
    [CmdletBinding()]
        param()

    $Obj = @()
    [void] [Reflection.Assembly]::LoadWithPartialName("System.Windows.Forms")
    [void] [Reflection.Assembly]::LoadWithPartialName("System.Drawing")
    $Screens = [System.Windows.Forms.Screen]::AllScreens

    ForEach ($Screen in $Screens) {
        $DeviceName = $Screen.DeviceName
        $Width  = $Screen.Bounds.Width
        $Height  = $Screen.Bounds.Height
        $IsPrimary = $Screen.Primary

     $Obj += New-Object -TypeName PSobject -Property @{DeviceName=$DeviceName;Width=$Width;Height=$Height;Primary=$IsPrimary}

    }  # End ForEach

    $Obj

}  # Get-ScreemResolution

Function Set-WallPaper($Image) {
 
Add-Type -TypeDefinition @" 
using System; 
using System.Runtime.InteropServices;
  
public class Params
{ 
    [DllImport("User32.dll",CharSet=CharSet.Unicode)] 
    public static extern int SystemParametersInfo (Int32 uAction, 
                                                   Int32 uParam, 
                                                   String lpvParam, 
                                                   Int32 fuWinIni);
}
"@ 
  
    $SPI_SETDESKWALLPAPER = 0x0014
    $UpdateIniFile = 0x01
    $SendChangeEvent = 0x02
  
    $fWinIni = $UpdateIniFile -bor $SendChangeEvent
  
    $ret = [Params]::SystemParametersInfo($SPI_SETDESKWALLPAPER, 0, $Image, $fWinIni)
 
}  # End Function Set-Wallpaper


# Determine how many desktop icons to make
$MaxIcons = 249
$ScreenCount = (Get-ScreenResolution).DeviceName.Count
$PublicIcons = @()
$UserIcons = @()
$PublicIcons += Get-ChildItem -Path "C:\Users\Public\Desktop" | Select-Object -Property FullName
$UserDesktop = "$env:USERPROFILE\Desktop"
$UserIcons = Get-ChildItem -Path $UserDesktop -ErrorAction SilentlyContinue | Select-Object -Property FullName
If (!(Test-Path -Path $UserDesktop)) { 

    $UserDesktop = "$env:USERPROFILE\*OneDrive\Desktop"
    $UserIcons += Get-ChildItem -Path (Get-ChildItem -Path $UserDesktop).FullName | Select-Object -Property FullName

}  # End If
$Compare = Compare-Object -ReferenceObject $PublicIcons -DifferenceObject $UserIcons -Property FullName | Where-Object { $_.SideIndicator -eq "=>" }
$CreateIconCount = $MaxIcons - $PublicIcons.Count - $UserIcons.Count
$Random = Get-Random -Maximum $CreateIconCount -Minimum 1


# Get Default browser
$Browser = (Get-ItemProperty -Path "HKCU:\Software\Microsoft\Windows\Shell\Associations\UrlAssociations\https\UserChoice" -Name "Progid").ProgId
If ($Browser -like "*Firefox*") { $Browser = "Firefox"; $BrowserPath = (Get-ChildItem -Path "$UserDesktop\Firefox*").FullName }
ElseIf ($Browser -like "*Chromium*") { $Browser = "Chromium"; $BrowserPath = (Get-ChildItem -Path "C:\Users\Public\Desktop\*Chromium*").FullName }
ElseIf ($Browser -like "*Chrome*") { $Browser = "Google Chrome"; $BrowserPath = (Get-ChildItem -Path "C:\Users\Public\Desktop\*Chrome*").FullName }
ElseIf ($Browser -like "*Brave*") { $Browser = "Brave"; $BrowserPath = (Get-ChildItem -Path "C:\Users\Public\Desktop\*Brave*").FullName }
ElseIf ($Browser -like "*Edge*") { $Browser = "Microsoft Edge"; $BrowserPath = (Get-ChildItem -Path "C:\Users\Public\Desktop\*Microsoft*Edge*").FullName }
ElseIf ($Browser -like "*Explorer*") { $Browser = "Internet Explorer"; $BrowserPath = (Get-ChildItem -Path "C:\Users\Public\Desktop\*Internet*Explorer*").FullName }
ElseIf ($Browser -like "*IE*") { $Browser = "Internet Explorer"; $BrowserPath = (Get-ChildItem -Path "C:\Users\Public\Desktop\*Internet*Explorer*").FullName }
Move-Item -Path $BrowserPath -Destination $BrowserPath.Replace(".lnk", " $Random.lnk") -Force -ErrorAction SilentlyContinue | Out-Null


# Create the game icons
$Content = "
<!DOCTYPE html>
<html>
    <head>Not this one, try again</head>

    <p>This page contains malicious code to mess up your device in some hard to initially recognize way.</p>

    <foot>Better luck next time!</foot>
</html>
"
$WebPage = "C:\Users\Public\Documents\site.html"
# Comment out the below line if you wish to define an actual site above
New-Item -Path $WebPage -ItemType File -Value $Content -Force -ErrorAction SilentlyContinue | Out-Null

$Count = 0
While ($Count -lt $CreateIconCount) {

    $Count++

    If ($Count -ne $Random) {

        # Set the correct icon image
        $IconResourcePath = "$env:USERPROFILE\Pictures\icon.bmp"
        Add-Type -AssemblyName System.Drawing
        $Icon = [System.Drawing.Icon]::ExtractAssociatedIcon($BrowserPath)
        $Icon.ToBitmap().Save($IconResourcePath)

        $ShortcutPath = ((Get-ChildItem -Path $UserDesktop -ErrorAction SilentlyContinue).FullName) + "\$Browser $Count.lnk"
        $Shell = New-Object -ComObject ("WScript.Shell")
        $Iconfile = "IconFile=" + $IconResourcePath
        $Shortcut = $Shell.CreateShortcut("$ShortcutPath")
        $Shortcut.TargetPath = $WebPage
        $Shortcut.Save()
        Add-Content $ShortcutPath "HotKey=0"
        Add-Content $ShortcutPath "$Iconfile"
        Add-Content $ShortcutPath "IconIndex=0"

    }  # End If

}  # End While



# Set SAW Themed wallpaper
$ImageBase64 = ""
$WallpaperImage = 'C:\Users\Public\Pictures\SAwPaper.jpg'
$Bytes = [Convert]::FromBase64String($ImageBase64)
[IO.File]::WriteAllBytes($WallpaperImage, $Bytes)
If (!(Test-Path -Path $WallpaperImage)) {

    Write-Warning "Failed to set wallpaper"

}  # End If
Set-WallPaper -Image $WallpaperImage -Force



# Minimize all windows
$Shell = New-Object -ComObject "Shell.Application"
$Shell.MinimizeAll()



# Open the instructions
$InstructionsPath = "$UserDesktop\Instructions-README.txt"
$Instructions = "
========================================================================
                      We1C0m3 2 SAwPapEr
========================================================================
 I want to play a game...

 On your desktop are mutliple icons that open with your favorite browser,
        One of them is not crippling malware,

                Begin
 "
 New-Item -Path $InstructionsPath -ItemType File -Value $Instructions -Force -ErrorAction SilentlyContinue | Out-Null
 Start-Process -FilePath "C:\Windows\System32\notepad.exe" -ArgumentList @($InstructionsPath)



# Undo operation
Read-Host -Prompt "Press ENTER to undo what the script did"
Set-WallPaper -Image $OldWallpaper -Force
Move-Item -Path $BrowserPath.Replace(".lnk", " $Random.lnk") -Destination $BrowserPath -Force -ErrorAction SilentlyContinue | Out-Null
$RemoveFiles = @()
$RemoveFiles += $WebPage, $IconResourcePath, $WallpaperImage, $InstructionsPath
$RemoveFiles += Get-ChildItem -Path (Get-ChildItem -Path "$UserDesktop").FullName -Filter "$Browser *.lnk" -ErrorAction SilentlyContinue -Force | Select-Object -ExpandProperty FullName
$RemoveFiles += Get-ChildItem -Path "C:\Users\Public\Desktop" -Filter "$Browser *.lnk" -ErrorAction SilentlyContinue -Force | Select-Object -ExpandProperty FullName
Remove-Item -Path $RemoveFiles -Force
